import React, { useState } from "react";  
import { StyleSheet, Text, View, TouchableOpacity } from "react-native";  
import { AuthSession } from "expo"; 
import axios from "axios";

const NV_APP_ID = "i90dwXdfWfTQaPy11Qqq";  
const NV_APP_SECRET = "dxyna27e4T";  
const STATE_STRING = "wiseSmoke";
const redirectUrl = "http://localhost:19006/";

function NaverLogin() {  

  return (
    <View style={Styles.container}>      
      <WebView
        style={{ flex: 1 }}
        originWhitelist={['*']}
        scalesPageToFit={false}
        source={{
          uri: `https://nid.naver.com/oauth2.0/authorize?response_type=code&client_id=${NV_APP_ID}&redirect_uri=${encodeURIComponent(
            redirectUrl
          )}&state=${STATE_STRING}`,
        }}
        injectedJavaScript={INJECTED_JAVASCRIPT}
        javaScriptEnabled
      />
    </View>
  );

}

export default NaverLogin;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});
